import React from "react";

function About() {
    return (
        <div>
            <p>This Application is designed to give insight into the various wonderful Indoor Colorado Concert Venues. <br />
                This Single Page Application was created by Kevin McIntosh for the Flatiron School Software Engineer Flex Program.</p>
        </div>
    )
}

export default About;
